import Cabecalho from "./Cabecalho";
import Menu from "./Menu";

export default function Pagina(props){
    return(
        <Container>
            <Cabecalho titulo={props.titulo}/>
            <Menu/>
            <div>
                Conteudo aqui.....
            </div>
        </Container>
    )
}
